import {BrowserRouter as Router, Link, Route} from 'react-router-dom'
import OrgCard from './OrgCard'
import OrgPageElements from './OrgPageElements'



class RenderOrgCards extends React.Component{


    constructor(props){
        super(props)
        this.state = {orgs: [{id: 12345, name: 'MyOrg', location: 'Hattiesburg Ms.'},{id:448894465, name: 'TheBestOrg', location: 'Mobile Al'}]}
    }

   // this.state = {orgs: this.props.orgs}

    render(){


        return( 

        <div>
            <Router>
            {this.state.orgs.map((org) => (



                    <div>
                        <Link to={'/organizations' + org.id} />
                        <Route path= '/organization/:org_id' component= {OrgPageElements}/>
                        <OrgCard id={org.id} name={org.name} location= {org.location} />
                    </div>



            ))}
            </Router> 

        </div>
        )
    } 
}

export default RenderOrgCards
